import React from 'react'
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom'

import AdminPrivateRoute from './layouts/admin/MasterPage';
import PublicRoute from "./PublicRoute";

import Login from "./components/frontend/auth/Login";
import Register from "./components/frontend/auth/Register";
import Home from "./components/frontend/Home";

import Page403 from "./components/error/Page403";
import Page404 from "./components/error/Page404";

function App() {
  return (
    <div className="App">
       <Router>
          <Switch>
            <Route path='/admin' exact name='Admin' component={AdminPrivateRoute}/>
            {/* <PublicRoute path="/" name='Home' /> */}

            <Route path='/403' exact={true} name="Page403" component={Page403} />
            <Route path='/404' exact={true} name="Page403" component={Page404} />

            <Route path="/login"component={Login} name='Login'/>
            <Route path="/register"component={Register} name='Register'/>
            <Route path="/home"component={Home} name='Home'/>
          </Switch>
      </Router>
    </div>
  );
}

export default App;
